import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // You will need to customize CSS

function Home() {
  return (
    <div className="homepage">
      {/* Background Video */}
      <video autoPlay muted loop className="background-video">
        <source src="/space-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      {/* Overlay Content */}
      <div className="overlay">
        {/* Navigation Bar */}
        <nav className="navbar">
          <ul>
            <li><Link to="/apod">APOD</Link></li>
            <li><Link to="/mars-photos">Mars Photos</Link></li>
            <li><Link to="/epic-images">EPIC Images</Link></li>
            <li><Link to="/neo">Near Earth Objects</Link></li>
            <li><Link to="/nasa-library">NASA Library</Link></li>
          </ul>
        </nav>

        {/* Description */}
        <div className="description">
          <h1>NASA Data Explorer</h1>
          <p>Explore space-related data from NASA's vast collection. View stunning images, learn about Mars rovers, explore near-Earth objects, and much more!</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
